window.bookSummaryJSON = "<p><b>Audie Award Finalist, Multi-Voiced Performance, 2014</b></p> <p>Return once more to a galaxy far, far away with this sublime retelling of George Lucas's epic <i>Star Wars</i> in the style of the immortal Bard of Avon. The saga of a wise (Jedi) knight and an evil (Sith) lord, of a beautiful princess held captive and a young hero coming of age, <i>Star Wars</i> abounds with all the valor and villainy of Shakespeare's greatest plays. 'Tis a tale told by fretful droids, full of faithful Wookiees and fearsome Stormtroopers, signifying...pretty much everything. </p> <p><i>William Shakespeare's Star Wars</i> will astound and edify Rebels and Imperials alike. Zounds! This <i>is</i> the audiobook you're looking for.</p>"; 
